async function GetDataJson(subject) {
    const response = await fetch(
      "https://www.googleapis.com/books/v1/volumes?q=subject:" + subject
    );
  
    return response.json();
  }
  
  var some = "NULL";
  GetDataJson("Fiction").then((val) => {
    some = val.totalItems.toString();
    console.log(some);
  });
  
  console.log(some);

function Layout(props) {
  return (
    <>
      <p>{props.some}</p>
    </>
  );
}

export default Layout;
